import { Route, Routes, Link, Navlink } from 'react-router-dom';
import './App.scss';
import Deprem from './components/Deprem';
import DepremKayip from './components/DepremKayip';
import Toplanma from './components/Toplanma';
import Bilgi from './components/Bilgi';


function App() {

 
  return (
    <div className='mainContainer'>
    <nav>
      <ul>
      <li>
          <Link className='link' to='overdrivetr.com/'>Deprem Kayıp Sistemi</Link>
      </li>
      <li>
          <Link className='link' to='overdrivetr.com/deprem-raporlari'>Deprem Raporları</Link>
      </li>
      <li>
          <Link className='link' to='overdrivetr.com/toplanma-alanlari'>Toplanma Alanları</Link>
      </li>
      <li>
          <Link className='link' to='overdrivetr.com/gonullu-bilgiler'>Gönüllü Bilgiler</Link>
      </li>
      </ul>
    </nav>
    <Routes>
      <Route path="overdrivetr.com/" element={<DepremKayip/>}/>
      <Route path='overdrivetr.com/deprem-raporlari' element={<Deprem />} />
      <Route path='overdrivetr.com/toplanma-alanlari' element={<Toplanma />} />
      <Route path='overdrivetr.com/gonullu-bilgiler' element={<Bilgi/>}/>
    </Routes>
  </div>
  );
}

export default App;
